In the intervening years the island has started developing at a pace never seen previously and has seen major infrastructure build programmes to keep pace with education and economic challenges.

Saint Lucia has also led medical and technological development in the Caribbean region and Saint Lucians continue to help push political developments in the Caribbean, at the same time retaining cultural and sporting identity, which has become a common factor across the Caribbean.

Saint Lucia Additionally:

~ is an offshore international banking sector -with 41 financial institutions representing 32 countries;

~ has close to 900 acres dedicated to agricultural land - the only major diversified crop in the region;

~ has a cruise ship port - renamed from Castries - which receives 350,000 passengers per year with confidence growing with government plans to further develop this area;

~ has become a large tourist zone - with over 60,000 visitors a year typically spending around $3-4 million a week;

~ has domestic airports servicing every region of the island\'s weekly 20,000 seat in regional territories;

~ has a new hospital which is now open with a planning permit for future growth in general medicine;

~ has a fast increasing internal GNI, reaching $10 billion last year;

~ has youth unemployment at 29%, with 100,000 young people out of work - a significant challenge for the Government;

